import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note" ;
import CreateNote from "./NoteArea";

function App(){

    function newNote(note){
        if(note!=null){
            console.log(note);
        }
    }

    return <div><Header />
    <CreateNote addNote = {newNote}/>
    <Note />
    <Footer />
    </div> ;
}

export default App;
